window.bookSummaryJSON = "<p>Sequel to <i>Darkest Hour Before Dawn</i>.</p> <p>When THIRDS Agent Dexter J. Daley met Team Leader Sloane Brodie, he couldn’t have imagined how slamming into his new partner -literally - would shake both their worlds. Now, four years later, they’ve faced dangers, fought battles both personal and professional...and fallen deeply in love. Now, their big moment is finally in sight, and they’re ready to stand up together and make it official. Unfortunately, as the countdown to their big day begins, an enemy declares war on the THIRDS....</p> <p>With their family in danger, Dex and Sloane are put to the test on how far into darkness they’ll walk to save those they love. As secrets are unearthed, a deadly betrayal is revealed, and Dex and Sloane must call on their Destructive Delta family for one last hurrah to put an end to the secret organization responsible for so much devastation.</p> <p>Dex and Sloane will have plenty of bullets to dodge on the way to the altar, but with happiness within their grasp, they are determined to get there, come hell or high water....</p>"; 
